function sendDataToPHP(canvasData) {
    fetch('./static/php/bdd.php', {
      method: 'POST',
      body: canvasData
    })
    .then(response => response.text())
    .then(data => {
      console.log('Success:', data);
      window.location.href = "/Avatar/Avatar.php";
    })
    .catch((error) => {
      console.error('Error:', error);
    });
  }

